import React, { useState } from 'react';

const Landing = () => {
  const [backgroundImage, setBackgroundImage] = useState();

  const landingStyle = {
    width: '100vw',
    height: '100vh',
    backgroundImage,
  };

  return (
    <div style={landingStyle}>
      <h1>Landing</h1>
    </div>
  );
};

export default Landing;
